import './App.css';
import NavBar from "./pages/NavBar";
import SocialBar from "./pages/SocialBar";
import { BrowserRouter as Router, Switch, Route, Redirect} from 'react-router-dom';
import Main from "./pages/Main"
import MainBar from "./pages/MainBar";



class App extends Component {

  render() {
    return (
      <div className="App">
      <Router>
        <div>
        <NavBar/>
        <SocialBar/>
          <Switch>
           <Main></Main>
            <Route path={"/"} exact render= {() => <Redirect to="/videos/d7321c6e-33a9-4585-bd81-1670fa9fa695"/>}/>  
            <Route path={"/videos/:id"} render={ (props) => { return <Main props={props} {...this.state} /> } }/>  
            <Route path={"/videos"} component={Main}/>  
            <Route path={"/upload"} component={Upload}/>
        </Switch>
        </div>
      </Router>  
    </div>
    );
  }
}
export default App;
